import React, { Component } from "react";

class SideBarItem extends Component {
  
  render() {
    const { project } = this.props;

    return (
      <div className="container">
        
          <div className="row">
         
              <h3>{project.topic}</h3>
              <p>{project.subTopic}</p>
            
            </div>
          </div>
    
    );
  }
}

export default SideBarItem;
